import Fonts from './Fonts';
import Headings from './Fonts';

const ThemeClasses = ({ themes, themeSelected }) => {
  let theme = themes.find((th) => themeSelected === th.themeValue);

  return (
    <>
      <Fonts theme={theme} />
      <Headings />
    </>
  );
};

export default ThemeClasses;
